import React from "react";

import Grid from "@material-ui/core/Grid";
import Card from "@material-ui/core/Card";
import CardActions from "@material-ui/core/CardActions";
import CardContent from "@material-ui/core/CardContent";
import Button from "@material-ui/core/Button";
import Typography from "@material-ui/core/Typography";

import ClassificadoItem from "../classificado-item/classificado-item";

const ClassificadoPreview = ({ id, ...otherProps }) => {
  return (
    <Grid
      className="classificado-preview"
      container
      justify="center"
      spacing={2}
    >
      <Grid key={id} item xs={10}>
        <Card className="classificado-card" variant="outlined">
          <ClassificadoItem key={id} {...otherProps} />
        </Card>
      </Grid>
    </Grid>
  );
};

export default ClassificadoPreview;
